import React, { Component } from 'react';
import './ResetStyles.css';

import { connect } from 'react-redux';
import { load_input_data } from '../../Redux/inputData/inputData-action';

const mapDispatchToProps = (dispatch) => {
  return {
    load_input_data: (data) => dispatch(load_input_data(data))
  }
}

class Reset extends Component {
	constructor(props) {
    super(props);
    this.handleClick = this.handleClick.bind(this);
  }

  handleClick() {
    this.props.load_input_data("");
  }

  render() {
   	return (
      <div className="tc input-file-container">
        <input type="button" id="my-reset" className="input-file" onClick={this.handleClick}/>
        <label tabindex="0" for="my-reset" className="input-file-trigger">Reset Turtle</label>  
      </div>
    );
  }
}


export default connect(null, mapDispatchToProps)(Reset);




